// Import các thư viện cần thiết
import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

// Component Header
export default function Header() {
  // Khởi tạo state cho user
  const [user, setUser] = useState(null);

  // Sử dụng useEffect để kiểm tra cookie khi component được render
  useEffect(() => {
    // Lấy giá trị của cookie "username"
    const username = document.cookie.replace(
      /(?:(?:^|.*;\s*)username\s*=\s*([^;]*).*$)|^.*$/,
      "$1"
    );
    // Nếu tồn tại giá trị của username, cập nhật state user
    if (username) {
      setUser(username);
    }
  }, []);

  // Hàm xử lý logout
  const handleLogout = async () => {
    try {
      // Gửi request đến endpoint logout trên server
      const response = await fetch("http://localhost:8080/user/logout");
      // Parse phản hồi từ server
      const data = await response.json();
      // Nếu request thành công
      if (response.ok) {
        // Xóa cookie thành công, cập nhật state user và hiển thị thông báo
        setUser(null);
        alert(data.message);
      } else {
        // Nếu request không thành công, hiển thị thông báo lỗi
        console.error("Đăng xuất không thành công:", data.error);
      }
    } catch (error) {
      // Xử lý lỗi nếu có
      console.error("Lỗi khi thực hiện đăng xuất:", error);
    }
  };

  // Trả về giao diện của Header
  return (
    <header className="header">
      <div className="container-fluid">
        <div className="row">
          <div className="col-xl-3 col-lg-2">
            <div className="header__logo">
              <img src="/img/open.png" alt="logo" />
            </div>
          </div>
          <div className="col-xl-6 col-lg-7">
            <nav className="header__menu">
              {/* Các menu và dropdown menu */}
            </nav>
          </div>
          <div className="col-lg-3">
            <div className="header__right">
              {/* Hiển thị phần header phải (thông tin user hoặc nút Login/Register) */}
              {user ? (
                <ul className="header__right__widget">
                  <li className="nav-item dropdown">
                    <a
                      className="nav-link dropdown-toggle d-flex align-items-center"
                      href="#"
                      id="navbarDropdownMenuLink"
                      role="button"
                      data-bs-toggle="dropdown"
                      aria-expanded="false"
                    >
                      <img
                        src="https://mdbcdn.b-cdn.net/img/Photos/Avatars/img (31).webp"
                        className="rounded-circle"
                        height="22"
                        alt="Avatar"
                        loading="lazy"
                      />
                      <span className="ms-1">{user}</span>
                    </a>
                    <ul
                      className="dropdown-menu"
                      aria-labelledby="navbarDropdownMenuLink"
                    >
                      <li>
                        <Link className="dropdown-item" to="/myprofile">
                          My profile
                        </Link>
                      </li>
                      <li>
                        <Link className="dropdown-item" to="/myhistory">
                          History
                        </Link>
                      </li>
                      <li>
                        {/* Gọi hàm handleLogout khi người dùng nhấp vào "Logout" */}
                        <button
                          className="dropdown-item"
                          onClick={handleLogout}
                        >
                          Logout
                        </button>
                      </li>
                    </ul>
                  </li>
                </ul>
              ) : (
                <div className="header__right__auth">
                  <Link to="/Login" className="nav-link">
                    Login
                  </Link>
                  <Link to="/Register" className="nav-link">
                    Register
                  </Link>
                </div>
              )}
            </div>
          </div>
        </div>
        <div className="canvas__open">
          <i className="fa fa-bars"></i>
        </div>
      </div>
    </header>
  );
}
